app1.controller("FileCtrl",["$scope","$routeParams","$location","SessionService","FileUrl",function(e,t,a,n,i){e.sessionData=n.getSessionData();var o=function(){if("undefined"==t.iframe_file||"undefined"==t.application_id)a.url("/applications");else{if(e.sessionData.application_id=t.application_id,e.sessionData.applications){for(var o=e.sessionData.applications,r=0;r<o.length;r++)if(o[r].translated_name=n.translate(o[r].name),o[r].translated_description=n.translate(o[r].description),o[r]._id==t.application_id){e.sessionData.applicationName=o[r].translated_name;break}n.setSessionData(e.sessionData)}i.get({id:t.iframe_file},function(e){document.getElementById("iframe_file").src="https://docs.google.com/viewer?url="+encodeURI(e.url)+"&embedded=true"})}};e.$watch(function(){return n.getSessionData().applications},function(t,a){t!=a&&(e.sessionData=n.getSessionData(),o())}),o()}]);
